function getAsset(formato: IFormats, fileName: string) {
	var b64 = "";
	if (formato.width === 300 && formato.height === 600) {
		const index = assets300600.findIndex((x: { fileName: string; }) => x.fileName === fileName);
		b64 = assets300600[index].b64 + " no-repeat";
	} else if (formato.width === 400 && formato.height === 400) {
		const index = assets400400.findIndex((x: { fileName: string; }) => x.fileName === fileName);
		b64 = assets400400[index].b64 + " no-repeat";
	}
	return b64;
}

export function getElementsTemplate(banner: string): ITemplate {
	try {
		if (banner) {
			const regex = /<script id="dynamicScript">([\s\S]*?)<\/script>/;
			const elementos = regex
			.exec(banner)![0]
			.replaceAll('var json = ', '')
			.replaceAll('<script id="dynamicScript">', '')
			.replaceAll('var e = ', '')
			.replaceAll('</script>', '');
			
			const json = JSON.parse(elementos);
			return {
				name: generateRandomString(),
				banner: banner,
				width: json.width,
				height: json.height,
				elementos: json.elementos,
				aproved: false,
				formats: [
					{width: 300, height: 600, active: true, html: ""},
					{width: 400, height: 400, active: false, html: ""}
				]
			} as ITemplate;
		}
		return null;
	} catch (error) {
		console.error('error');
		console.error(error);
		return null;
	}
}

export function buildCreativeLine(formato: any, creative: any, index: number) {
	creative.forEach((element: any) => {
		if (element.tipo === 'b64') {
			element.value = getAsset(formato, element.imageName);
			console.log('element.value')
			console.log(element.value)
		}
	});
	var template = formato.html.replaceAll('//buildHTML();', 'buildHTML();')
	var regex = /<script id="dynamicScript">[\s\S]*?<\/script>/;
	var newHtmlString = template.replace(regex, '');
	newHtmlString += `
	<script id="dynamicScript">
		var e = {
			"elementos": ${JSON.stringify(creative)}
		}
		
		function buildHTML() {
			console.log('buildHTML')
			for (var i = 0; i < e.elementos.length; i++) {
				const elemento = e.elementos[i];
				var div = document.getElementById(elemento.id);
				if (!div) continue;
				if (elemento.tipo === 'b64') {
					div.style.background = elemento.value;
				} else if (elemento.tipo === 'text') {
					div.innerHTML = elemento.value;
				}
			}
		}
	
		buildHTML();
	</script>
	`;
	console.log('newHtmlString')
	console.log(newHtmlString)
	return newHtmlString;
}

export function videoScriptTimeline(delays: any) {
	var script = `<script type="text/javascript">
	var time = 0;
	function setTime(t) {
		time += t;
	  const ids = [`
  
	delays.forEach((delay: any) => {
	  script += `{\nid: "${delay.name}",\ndelay: ${delay.delay},\nanimation: "${delay.animation}",\ntype: "${delay.type}",\nopacity: ${delay.type !== 'OUT'}\n}\n,\n`
	});
  
	script += `]
	ids.forEach((id, index) => {
		try {        
		  let delay = id.delay - time;
		  let css = document.getElementsByClassName(id.id)[0];
		  css.style['animationPlayState'] = 'paused'
		  if (delay > 0) {
			css.style.opacity = 0;
		  } else {
			try {
			  if (id.type === "OUT" && !id.opacity) {
				id.opacity = true;
				css.style.opacity = 1;
			  }
			} catch {}
			css.style.animationDelay = delay + 'ms';
			css.className = id.id + " " + id.animation;
		  }
		} catch {}
	  });
	}
	setTime(0)
  </script>`
  return script;
  }

export function downloadVideo(base64Data:string, filename: string) {
	const blob = b64toBlob(base64Data);
	const url = URL.createObjectURL(blob);
  
	const link = document.createElement('a');
	link.href = url;
	link.download = filename;
	link.click();
  
	URL.revokeObjectURL(url);
  }

  
function b64toBlob(base64Data:string) {
	const byteCharacters = atob(base64Data);
	const byteNumbers = new Array(byteCharacters.length);
	for (let i = 0; i < byteCharacters.length; i++) {
	byteNumbers[i] = byteCharacters.charCodeAt(i);
	}
	const byteArray = new Uint8Array(byteNumbers);
	return new Blob([byteArray]);
}